import React, { useState, createContext, useContext } from 'react';
import { Link } from 'react-router-dom';
import '@fortawesome/fontawesome-free/css/all.min.css';
import { Menu, LogOut, FileText, ChevronLeft } from 'lucide-react';

const SidebarContext = createContext();

export function Dashboard() {
  const [expanded, setExpanded] = useState(true);

  const toggleSidebar = () => {
    setExpanded(!expanded);
  };

  return (
    <div className={`h-screen bg-gray-200 text-gray-900 flex`}>
      <SidebarContext.Provider value={{ expanded }}>
        <aside className={`h-screen ${expanded ? "w-64" : "w-20"} transition-all duration-300`}>
          <nav className="h-[calc(100%-2rem)] flex flex-col bg-blue-400 shadow-xl ml-6 mt-8 mb-4 rounded-xl">
            <div className="p-4 pb-2 flex justify-between items-center">
              <button
                onClick={toggleSidebar}
                className="p-1.5 rounded-lg hover:bg-blue-300 transition-colors"
              >
                <Menu className={`w-6 h-6 text-white transition-transform duration-300 ${expanded ? '' : 'transform rotate-180'}`} />
              </button>
              {expanded && <span className="text-lg font-medium text-white">Menu</span>}
              {expanded && <ChevronLeft className="w-5 h-5 text-white" />}
            </div>
            <ul className="flex-1 px-3">
              <SidebarItem icon={FileText} text="Soal" to="/soal" alert active />
              {/* Tambahkan item sidebar lainnya di sini jika diperlukan */}
            </ul>
            <div className="border-t border-blue-300 flex p-3">
              <SidebarItem icon={LogOut} text="Logout" to="/registration" />
            </div>
          </nav>
        </aside>
      </SidebarContext.Provider>

      <div className="bg-white flex-grow flex justify-center items-center">
        <div className="bg-white rounded-lg shadow-2xl p-12 w-[70%] max-w-[800px]">
          <h2 className="text-2xl mb-8 font-bold text-left">Input Data Diri</h2>
          <form className="space-y-6 ">
            <div className="input-group flex flex-col mb-5 w-full">
              <label className="text-sm mb-2">Nama Peserta</label>
              <input
                 type="text"
                 placeholder="Nama Peserta"
                 className="border border-gray-300 rounded-full py-2 px-4 text-base shadow-md w-full"
               />
            </div>
            <div className="input-group flex flex-col mb-5 w-full">
              <label className="text-sm mb-2">Deskripsi</label>
              <input
                 type="text"
                 placeholder="Deskripsi"
                 className="border border-gray-300 rounded-full py-2 px-4 text-base shadow-md w-full"
               />
            </div>
            <div className="input-group flex flex-col mb-5 w-full">
              <label className="text-sm mb-2">Nama Instansi</label>
              <input
                 type="text"
                 placeholder="Nama Instansi"
                 className="border border-gray-300 rounded-full py-2 px-4 text-base shadow-md w-full"
               />
            </div>
            <button
               type="submit"
               className="submit-btn bg-black text-white py-2 px-8 rounded-full cursor-pointer text-base mt-8 self-end hover:bg-gray-800"
            >
              Selesai
            </button>
          </form>
        </div>
      </div>
    </div>
  );
}

function SidebarItem({ icon: Icon, text, to, active, alert }) {
  const { expanded } = useContext(SidebarContext);

  return (
    <li className={`
      relative flex items-center py-2 px-3 my-1
      font-medium rounded-md cursor-pointer
      transition-colors group
      ${active 
        ? "bg-gradient-to-tr from-indigo-200 to-indigo-100 text-blue-800" 
        : "text-white hover:bg-blue-300"
      }
    `}>
      <Link to={to} className="flex items-center w-full">
        <Icon className="w-6 h-6 mr-3" />
        {expanded && <span>{text}</span>}
      </Link>
      {alert && (
        <div className="absolute right-2 w-2 h-2 rounded bg-red-500" />
      )}
      {!expanded && (
        <div className={`
          absolute left-full rounded-md px-2 py-1 ml-6
          bg-indigo-100 text-blue-800 text-sm
          invisible opacity-20 -translate-x-3 transition-all
          group-hover:visible group-hover:opacity-100 group-hover:translate-x-0
        `}>
          {text}
        </div>
      )}
    </li>
  );
}

export default Dashboard;
